function Home() {
 const [user,setUser]=useState(null)
  useEffect(()=>{
    axios.get('http://localhost:8000/api/auth/user').then((response)=>{
     setUSer(response.data)
    }).catch((err)=>{
      console.log(error)
    })
  })
  return (
    
    <Fragment>
     <Navbar/> 
     <Banner/>
     <TopDeal/>
     <Packages/>
     <Services/>
     <Reviews/>
     <ContactUs/>
     <Footer/>
   </Fragment>
  ) 
}

export default Home
